import React ,{useState, useEffect} from 'react';
import './index.css'
import Icon2 from "../../images/city.jpeg";
import {Button} from '../ButtonElementRedirect';
import Axios from 'axios';
import {useParams} from 'react-router-dom';
import {serverURL} from '../../APIconfig';


function ArtistDetails() {
    const [docs, setDocs] = useState([])
    // Axios.get

    const params = useParams()

    useEffect(() => {
        Axios.get(serverURL+ '/getArtists/' + params.id)
        .then((res) => {
            console.log(res.data[0]);
            setDocs(res.data[0]);
            console.log(docs);
        })
        .catch((err) => console.log(err))    
    }, [])



    return (
        <div class='container'>
            <div class="wrapper">
                <div class="card1">
                    <img src={docs.image_path} alt="Hey" class="image"/>
                </div>
                <div class="card2">
                    <div class="name">{}</div>
                    <div class="artist">'Hey'</div>
                    <div class="amt"><b>'Hey</b></div>
                    <div class='taxes'>Local Taxes Included</div>
                    <div class="size">Available in </div>
                    <div class="stock"><b>In Stock</b></div>
                </div>
            </div>
        </div>
    )
}

export default ArtistDetails;
